import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    const initialShot = path.join(screenshotsDir, 'step_1_initial.png');
    await page.screenshot({ path: initialShot });
    screenshots.push(initialShot);

    // Wait for the first product card using a unique selector (first .product-card)
    await page.waitForSelector('.product-card', { timeout: 5000 });

    // Use nth-of-type to select the first product card's "Add to Cart" button
    // This avoids relying on IDs or text, and is different from previous attempts
    const firstAddToCartBtn = await page.$('css=.product-card:nth-of-type(1) >> css=.add-to-cart');
    if (!firstAddToCartBtn) {
      throw new Error('Could not find the first product card or its Add to Cart button');
    }

    // Scroll into view and click the button
    await firstAddToCartBtn.scrollIntoViewIfNeeded();
    await firstAddToCartBtn.click();

    // Wait for the notification to appear (using .notification.success)
    await page.waitForSelector('.notification.success', { timeout: 5000 });

    // Take screenshot after adding to cart
    const afterAddShot = path.join(screenshotsDir, 'step_2_after_add_to_cart.png');
    await page.screenshot({ path: afterAddShot });
    screenshots.push(afterAddShot);

    // Extract cart count from the cart counter element
    // Try both #cartCount and .cart (fallback)
    let cartCountText = '';
    const cartCountElem = await page.$('#cartCount');
    if (cartCountElem) {
      cartCountText = (await cartCountElem.textContent()).trim();
    } else {
      // Fallback: extract from .cart (should contain number and "Cart")
      const cartDiv = await page.$('.cart');
      if (cartDiv) {
        cartCountText = (await cartDiv.textContent()).replace(/[^0-9]/g, '').trim();
      }
    }

    // Return result
    return {
      success: true,
      action: "Added the first product to cart using the first visible product card's Add to Cart button",
      extractedData: {
        cartCount: cartCountText
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
